import Logo from "../assets/img/logo.png";
import "../styles/Header.css";

function Header() {
  return (
    <div>
      <div className="header-name-logo">
        <img className="website-logo" src={Logo} alt="" />
        <span className="website-name">SportSee</span>
      </div>
      <nav>
          <ul>
              <li>Accueil</li>
              <li>Profil</li>
              <li>Réglave</li>
              <li>Communauté</li>
          </ul>
      </nav>
    </div>
  );
}

export default Header;
